import './Tabular.css'

import React from 'react'

export default function Tabular(props) {
   const data = props.results.map((d,index)=>{
   return <table>
              <thead>
                 <tr>
                    <td colSpan='2' className=''>{d.name} Details</td>
                   

                 </tr>
                
              </thead>
         </table>

   })
  return (
    <div>

    </div>
  )
}
